import React from "react";
import styled from "styled-components";
import logo from "../assets/logo.png";

const LoginWrapper = styled.div`
  max-width: 940px;
  margin: 0 auto;
`;

export default function Login() {
  return (
    <LoginWrapper>
      <div></div>
    </LoginWrapper>
  );
}
